import React from "react";
import Header from "./components/Header";
import './Internship.css';
import Name from './components/Name'
import 'bootstrap/dist/css/bootstrap.css';
import Container from 'react-bootstrap/Container';
import { Row, Col } from "react-bootstrap";
import Footer from './components/Footer';

function Home(){
      return (
        <div>
            <Header/>
             <Container>
                <Row>
                    <Col className="internshipBox">
                        <div className="internship">
                            <div className="internshipDate"> 07 December 2021 - Present </div>
                            <div className="internshipHeading"> Software Engineer Intern </div>
                            <div className="internshipCompany"> Glasswing </div>
                            <div className="internshipBody"></div>
                        </div>
                        <div className="space">
                        Researching on AST - toolbox to compare the performance of search based software testing for self driving cars using AI.
                        </div>
                    </Col>
                </Row>
            </Container> 
            <Name/>
            <Footer/>
        </div>
      );

  }

export default Home;
